import React,{ useRef, useState } from "react";
import axios from 'axios';
import { useNavigate } from "react-router-dom";


const Loginform = () => {
    const [data,setData]=useState({email:"",password:""});
    // const [password,setPassword]=useState("");
  const navigate= useNavigate();
    const ref1 = useRef();

    const valUpdate= (e)=>{
      setData({...data,[e.target.name]:e.target.value})
    }
    
    const PostData=()=>{
      // data.preventDefault();
      axios.post('http://localhost:4000/regRoute/login',{email:data.email,password:data.password}).then((res)=>{console.log(res.data);
          ref1.current.innerText=res.data.msg;
        }
      ).catch(err=>(err.message));
    } 
  return (
    <>
      <section>
        <div>    
       
        <label htmlFor=""> Email: </label>
         <input type="email" name="email"  onChange={valUpdate}/> <br /> <br />
         <label htmlFor="">Password: </label>
         <input type="password" name="password" onChange={valUpdate}/> <br /> <br />
        <button onClick={PostData}>Data Post</button>    
        </div>
        <div>
            <link rel="stylesheet" onClick={()=>navigate('/register')}>Register</link>
        </div>
      </section>
    </>
  )
}

export default Loginform
